import React from 'react';
import Main from './containers/Main';
import Particles from 'react-particles-js';

function App() {
    return (
      <div className='App'>
        <Particles 
                    params={{
                        "particles": {
                            "number": {
                                "value": 200
                            },
                        color: {
                            value:'#ccc'
                        },
                        shape:{
                            type:'circle',
                            stroke: {
                                width:1,
                                color: '#fff'
                            }
                        }
                    }
                }} 
            />
        <Main />
      </div>
    );
  }

  export default App;
